/**
 * File Description: This component is the left pane of the website to display the results of search
 * Author(s): Sashank Pindiproli
 * Date of Creation: 02/02/2020
 */

import React from 'react';
import styled from 'styled-components';
import ToggleBtnComponent from '../ToggleButton';

const LeftPane = () => {
  const radios = [
    { name: 'Active', value: '1' },
    { name: 'Radio', value: '2' },
    { name: 'Radio', value: '3' },
  ];
  return (
    <StyledContainer>
      <ToggleBtnComponent {...radios} />
    </StyledContainer>
  );
};

const StyledContainer = styled.div`
  border: 2px solid black;
  width: calc(33%);
  display: flex;
  margin-top: 0.5vh;
`;

export default LeftPane;
